import React from 'react';
import '../AssignPage/AssignPage.css';
import { Row, Col, Button } from 'react-bootstrap';

//Components
import {Box} from '../../components/Box/Box.js';

const AssignPage = () => {
    return(
        <>
        <Row>
            {/* This is where the filter and search bar will go. */}
        </Row>
        <Row>
            <Box styletext="*Filer and Search*" />
        </Row>
        <br></br>
        <Box style={{height: "200px"}} text="*Description*" />
        </>
    )
}

export default AssignPage;
